import { useLocation } from "react-router-dom";

const Summary = () => {
    const location = useLocation();
    const playerStats = location.state;

    // Use playerStats to render the summary component
    return (
      <div>
        <h2>Summary</h2>
        <p>Score: {playerStats.score}</p>
        <p>Number of Questions: {playerStats.numberOfQuestions}</p>
        <p>Number of Answered Questions: {playerStats.numberOfAnsweredQuestions}</p>
        <p>Correct Answers: {playerStats.correctAnswers}</p>
        <p>Wrong Answers: {playerStats.wrongAnswers}</p>
      </div>
    );
  };

  export default Summary;
